/*Table structure for table `credit_cards` */

DROP TABLE IF EXISTS `credit_cards`;

CREATE TABLE `credit_cards` (
  `creditCardID` int(11) NOT NULL AUTO_INCREMENT,
  `creditCardNumber` int(12) NOT NULL,
  `creditCardName` varchar(100) NOT NULL,
  `creditCardHolder` varchar(100) NOT NULL,
  `expirationDate` varchar(20) NOT NULL,
  `cvcCode` int(11) NOT NULL,
  `userID` int(11) NOT NULL,
  PRIMARY KEY (`creditCardID`),
  KEY `userID` (`userID`),
  CONSTRAINT `credit_cards_ibfk_1` FOREIGN KEY (`userID`) REFERENCES `users` (`userID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4;

