/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `userID` int(11) NOT NULL AUTO_INCREMENT,
  `userImage` longblob DEFAULT NULL,
  `username` varchar(20) NOT NULL,
  `password` varchar(255) NOT NULL,
  `role` varchar(20) NOT NULL,
  `userProfileID` int(11) NOT NULL DEFAULT 2,
  `userAddressID` int(11) NOT NULL,
  PRIMARY KEY (`userID`),
  KEY `userProfileID` (`userProfileID`),
  KEY `users_ibfk_2` (`userAddressID`),
  CONSTRAINT `users_ibfk_1` FOREIGN KEY (`userProfileID`) REFERENCES `user_profile` (`userProfileID`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `users_ibfk_2` FOREIGN KEY (`userAddressID`) REFERENCES `user_address` (`userAddressID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4;

