/* Procedure structure for procedure `insert_credit_card` */

/*!50003 DROP PROCEDURE IF EXISTS  `insert_credit_card` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_credit_card`(
	nameInput varchar(100),
	cardNumberInput int(12),
	providerInput varchar(100),
	expDateInput varchar(20),
	cvcCodeInput int,
	userIDInput int
)
BEGIN

INSERT INTO credit_cards(creditCardNumber, creditCardName, creditCardHolder, expirationDate, cvcCode, userID)
values(
	cardNumberInput,
	providerInput,
	nameInput,
	expDateInput,
	cvcCodeInput,
	userIDInput
);

END */$$
DELIMITER ;

/* Procedure structure for procedure `insert_order` */

/*!50003 DROP PROCEDURE IF EXISTS  `insert_order` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_order`(
	userIDInput INT
)
begin

INSERT INTO orders(orderDate, `status`, userID)
VALUES(current_date(), 'Pending', userIDInput);

end */$$
DELIMITER ;

/* Procedure structure for procedure `insert_order_details` */

/*!50003 DROP PROCEDURE IF EXISTS  `insert_order_details` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_order_details`(
	userIDInput int,
	quantityInput int,
	productIDInput int,
	productSizeIDInput int,
	productFlavorIDInput int
)
begin

INSERT INTO order_details(quantity, orderDescription, orderID, productID, productSizeID, productFlavorID)
VALUES(
	quantityInput,
	(
		SELECT
		CONCAT(
			productName,
			(SELECT IF(productSizeName = "NA", "", CONCAT(' - ', productSizeName)) FROM product_sizes WHERE productSizeID = productSizeIDInput),
			(SELECT IF(flavorName = "NA", "", CONCAT(' - ', flavorName)) FROM product_flavors WHERE flavorID = productFlavorIDInput)
		)
		FROM products
		WHERE productID = productIDInput
	),
	(SELECT MAX(orderID) from orders WHERE userID = userIDInput LIMIT 1),
	productIDInput,
	productSizeIDInput,
	productFlavorIDInput
);

end */$$
DELIMITER ;

